import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import './App.scss';
import Navbar from './Nav';
import Home from './Home';

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Route path = '/'>
          <Home />
        </Route>
      </Router>

    </div>
  )
}

export default App;
